import React from 'react';
import './Login.css';

class Login extends React.Component{
  constructor(props){
    super(props);
  }


  render(){
    return(
      <div className="banner">
        <h4>EvCharge</h4>
        <h3>Login and start Charging</h3>
          <div className="login_div">
            <p>User</p>
            <input type="text" name="username" field="username" placeholder="username" value="" />
            <p>Password</p>
            <input type="text" field="password" placeholder="password" value="" />
            <button type="button" name="login">Login</button>
          </div>
          <div className="logout_div">
            <button type="button" name="logout">Logout</button>
          </div>
      </div>
    );
  }
}

export default Login;
